import numpy as np
import sympy as sp
import matplotlib.pyplot as plt


def lower_triangle_from_flat(flat, s):
    A = np.zeros((s, s))
    idx = 0
    for i in range(1, s):
        for j in range(i):
            A[i, j] = flat[idx]
            idx += 1
    return A

